import React, { Component } from 'react'
import logo from"../logo.svg"
import {Link} from "react-router-dom"
import Styled from "styled-components"
export default class  extends Component {
    render() {
        return (
           <nav className="nav-wrapper purple darken-4">
    <Link to="/"><img src={logo} alt="logo" className="  brand-logo" ></img></Link>
    <ul id="nav-mobile" className= " right hide-on-med-and-down">
    <li><Link to="/" >Products  </Link></li>
    <li><Link to="/cart" ><button className="btn waves-effect blue darken-4">
    <i className="fas fa-cart-plus" ></i>  My-Cart</button></Link></li>
           
    </ul>
    
    
   
      

           </nav>
        )
    }
}
